import MyCard from "../UI/MyCard";
import { useSelector } from "react-redux";
import LoadingSpinnerp from "../UI/LoadingSpinnerp";
import style from "./CardData.module.css"
import { useState } from "react";


const CardData = ()=>{
    const getSuccess = useSelector(state=>state.myPage.getSuccess)
    const viziblePage = useSelector(state=>state.myPage.pageList)
    const [showRow, setShowRow] = useState()

    const rowHadler=()=>{ 

       
       for (let i=0; i<10; i+=1){

           setShowRow(<div className={style.rowStyle}>
           {viziblePage[(1+i)].map((item)=>
            <MyCard 
            card_element = {item.card_element}
            />)
            }
            </div>)
            console.log(showRow)
            return showRow
       }
    
    }

    return <div >
        {getSuccess ? rowHadler() : <LoadingSpinnerp/>}
    </div>

}

export default CardData;
